import React from 'react';
import { createRoot } from 'react-dom/client';

export function Article(props)
{

    function printInfo(title,author,body)
    {
        console.log(`Title: ${title}, Author: ${author}, Body:${body}`);
    }
    return(
        <table>
            <button onClick={()=>printInfo('title','author','body')}>Print info</button>
        </table>
    );
}

createRoot(document.getElementById('app')).render(<Article/>);
